import React from 'react';
import { useHistory } from 'react-router';
import { Link } from 'react-router-dom';
const Home = () => {
    return (
        <div className="container-fluid mt-5 bg-dark text-white">
            <div className="row">
                <div className="col-md-6">
                    <img alt="login" src="https://www.elegantthemes.com/blog/wp-content/uploads/2021/03/one-click-gmail-login-for-wordpress-featured-image.jpg"/>
                    <Link className="bg-success" to="/login">Login</Link>
                </div>
                <div className="col-md-6">
                    <Link className="bg-primary" to="/register">Register</Link>
                </div>
            </div>
        </div>
    )
}

export default Home;
